#!/usr/bin/env
from icecream import ic
import os
import base64

#base to pic
base64_str = ""

def base2pic(base64_str, pic_path):
    with open(pic_path, 'wb') as f:
        f.write(base64.b64decode(base64_str))
        return pic_path

base2pic(base64_str, 'pic.jpg')
